import React from "react";
import axios from "axios"

export default class Test extends React.Component {
    state = {
        id: 23,
        month: 'jan',
        a1:''
    };



    componentWillMount() {
        const response = axios({
            method: 'patch',
            url: 'http://192.168.1.245:8095/updatemonthvalue',
            data: this.state
        })
            .then(response => {
                if (response.data.length != 0) {
                    console.log(JSON.stringify(response.data[1].ans))
                    this.setState({a1:response.data[0].ans})
                    this.setState({a2:response.data[1].ans})
                    this.setState({a1:response.data[1].ans})
                    this.setState({a1:response.data[1].ans})
                }
                else {
                    console.log('Null')
                }
            })

        }



    render() {
        return (
            <div>
                <div>{this.state.a1}</div>
                {/* <div>{response.data[1].ans}</div>
                <div>{response.data[2].ans}</div> */}

            </div>
        );
    }
}
